    private fun findChunkIndex(codePoint: Int): Int {
        var low = 0
        var high = chunkEnds.size - 1
        while (low <= high) {
            val mid = (low + high) ushr 1
            val end = chunkEnds[mid]
            if (end < codePoint) {
